import React, { useState, useEffect } from 'react';
import { ArrowLeft } from 'lucide-react';

const TrafficIndicator = ({ value, label }) => {
  // Convert the value to a percentage for the arc (0 to 100)
  const percentage = typeof value === 'number' ? value : 0;
  const rotation = (percentage / 100) * 180;

  let intensityText = 'Closed';
  if (percentage > 0) {
    if (percentage < 25) intensityText = 'Low';
    else if (percentage < 50) intensityText = 'Moderate';
    else if (percentage < 75) intensityText = 'High';
    else intensityText = 'Very High';
  }

  return (
    <div className="bg-white p-6 rounded-lg shadow-md">
      <h3 className="text-lg font-semibold mb-4">{label}</h3>
      <div className="relative w-48 h-24 mx-auto">
        <div 
          className="absolute w-48 h-48 border-[16px] border-gray-200 rounded-full"
          style={{ 
            clipPath: 'polygon(0 50%, 100% 50%, 100% 0, 0 0)',
          }}
        />
        <div 
          className="absolute w-48 h-48 border-[16px] border-emerald-400 rounded-full transition-all duration-500"
          style={{ 
            clipPath: 'polygon(0 50%, 100% 50%, 100% 0, 0 0)',
            transform: `rotate(${rotation}deg)`,
            transformOrigin: 'bottom center',
          }}
        />
        <div className="absolute bottom-0 left-0 right-0 text-center">
          <div className="text-lg font-semibold text-gray-600">{intensityText}</div>
          <div className="text-sm text-gray-500">{percentage}% busy</div>
        </div>
      </div>
    </div>
  );
};

const ResultsPage = () => {
  const [trafficData, setTrafficData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [venueName, setVenueName] = useState('');
  const [venueAddress, setVenueAddress] = useState('');

  useEffect(() => {
    const searchParams = new URLSearchParams(window.location.search);
    const name = searchParams.get('name');
    const address = searchParams.get('address');

    setVenueName(name || '');
    setVenueAddress(address || '');

    const fetchTrafficData = async () => {
      try {
        // Combine name and address for the search query
        const searchQuery = `${name} ${address}`.trim();

        // First, search for the venue
        const searchResponse = await fetch(
          `https://besttime.app/api/v1/venues/search?` + 
          new URLSearchParams({
            api_key_public: 'pub_3d06d92b6c19492fb4c5bc825d04ab4c',
            q: searchQuery
          })
        );

        const searchData = await searchResponse.json();

        if (searchData.status !== 'OK' || !searchData.venues || searchData.venues.length === 0) {
          throw new Error(searchData.message || 'No venues found');
        }

        const venue = searchData.venues[0];

        // Then, get the live forecast for the found venue
        const forecastResponse = await fetch(
          `https://besttime.app/api/v1/forecasts/live?` + 
          new URLSearchParams({
            api_key_private: 'pri_070565f833f9459aad223978a7a19b74',
            venue_id: venue.venue_id
          })
        );

        const forecastData = await forecastResponse.json();

        if (forecastData.status !== 'OK') {
          throw new Error(forecastData.message || 'Failed to fetch forecast data');
        }

        setTrafficData(forecastData);
      } catch (err) {
        setError(err.message || 'An error occurred while fetching data.');
        console.error(err);
      } finally {
        setLoading(false);
      }
    };

    if (name || address) {
      fetchTrafficData();
    } else {
      setError('No venue information provided.');
      setLoading(false);
    }
  }, []);

  return (
    <div className="min-h-screen bg-gray-100 p-8">
      <div className="max-w-4xl mx-auto">
        <div className="mb-8">
          <button 
            onClick={() => window.location.href = '/'}
            className="flex items-center text-blue-600 hover:text-blue-800"
          >
            <ArrowLeft className="mr-2" size={20} />
            Back to Search
          </button>
        </div>

        <h1 className="text-2xl font-bold mb-2">{venueName}</h1>
        <p className="text-gray-600 mb-8">{venueAddress}</p>

        {loading && (
          <div className="text-center text-gray-600">
            Loading traffic data...
          </div>
        )}

        {error && (
          <div className="text-center text-red-500">
            Error: {error}
          </div>
        )}

        {trafficData && !loading && !error && (
          <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
            <TrafficIndicator 
              value={trafficData.analysis?.now?.intensity || 0} 
              label="Now (Live)"
            />
            <TrafficIndicator 
              value={trafficData.analysis?.next_two_hours?.intensity || 0} 
              label="In 2 Hours (Forecasted)"
            />
          </div>
        )}
      </div>
    </div>
  );
};

export default ResultsPage;
